import React, { useState } from 'react';
import {
  CitySelect,
  CountrySelect,
  StateSelect,
  LanguageSelect,
} from 'react-country-state-city';
import 'react-country-state-city/dist/react-country-state-city.css';

export default function Home() {
  const [countryid, setCountryid] = useState(0);
  const [stateid, setStateid] = useState(0); // Fixed typo here
  return (
    <div>
      <h6>Country</h6>
      <CountrySelect
        onChange={(e) => {
          setCountryid(e.id);
        }}
        placeHolder="Select Country"
      />
      <h6>State</h6>
      <StateSelect
        countryid={countryid}
        onChange={(e) => {
          setStateid(e.id); // Fixed typo here
        }}
        placeHolder="Select State"
      />
      <h6>City</h6>
      <CitySelect
        countryid={countryid}
        stateid={stateid}
        onChange={(e) => {
          console.log(e);
        }}
        placeHolder="Select City"
      />
    </div>
  );
}
